import { Fragment } from "react";

import HeaderCartButton from "./HeaderCartButton";
import mealsImage from "../../assets/panda.jpeg";
import classes from "./Header.module.css";
import { Icon } from "antd";
import 'antd/dist/antd.css';
import "antd/dist/antd.css";


const Header = (props) => {
  // const btnClasses = `${classes.button} ${btnIsHighlighted ? classes.bump : ''}`;
  return (
    <Fragment>
      <header className={classes.header}>
        <h1 className={classes.h1}>Asian Food Market</h1>
        <button className={classes.button} onClick={props.onshowAbout}>
          <span>About us</span>
        </button>

        <button className={classes.button} onClick={props.onshowMenu}>
          <span>Menu</span>
        </button>

        <button className={classes.button} onClick={props.onshowContact}>
          <span>Contact us</span>
        </button>

        <HeaderCartButton onClick={props.onShowCart} />
      </header>
      <div className={classes["main-image"]}>
        <img src={mealsImage} alt="kongfu-pandas" />
      </div>
    </Fragment>
  );
};

export default Header;
